Nix Flakes Nix Flakes can be used to build, test and install garden. A flake.nix file is provided in the source tree. Enabling flakes permanently is recommended by either adding experimental-features = nix-command flakes to your ~/.config/nix/nix.conf or /etc/nix/nix.conf, or by using Home Manager to install flakes. The following commands are available once installed. nix build builds the garden package. nix shell opens a shell with garden installed. nix run directly run garden. nix develop opens a development shell with garden and cargo installed. nix flake check builds garden and runs the test suite. Activating Garden's Nix Package You can open a nix shell with garden installed by issuing the following command from any directory: nix shell github:garden-rs/garden Alternatively, you can also run garden directly by issuing nix run as follows: nix run github:garden-rs/garden -- --help Inside Garden's git repository, you can inspect its derivation by issuing nix derivation show. The output.path field contains the Nix Store location of the nix package. For example, nix derivation show will contain output that looks like the following: { "/nix/store/n92qrx1j889bl2ippabpghsr4kyqbknh-garden-tools-1.0.0-beta2.drv": { # ... "outputs": { "out": { "path": "/nix/store/8i7pgb529lq8id1z4xfmcyh8xsc4w6q0-garden-tools-1.0.0-beta2" } }, # ... }
} You can use these details to open a shell with your previously-built garden package. nix-shell -p /nix/store/8i7pgb529lq8id1z4xfmcyh8xsc4w6q0-garden-tools-1.0.0-beta2 Nix home-manager integration One may also use home-manager to have a permanent environment with garden available across all shells. This can be done by setting up a derivation in your home-manager configuration. Example: File /path/to/home-manager/derivations/garden.nix: { lib, fetchFromGitHub, rustPlatform }: rustPlatform.buildRustPackage rec { pname = "garden"; version = "v1.8.0"; src = fetchFromGitHub { owner = "garden-rs"; repo = "garden"; rev = version; hash = "sha256-+hcjHuJvqxkp+5FikVb8+mpU6rObC4xkMj/NBZDYTrQ="; }; cargoHash = "sha256-12X4bMDAQTLZfiPSbY9cPXB8cW1L0zYrts5F5CXzV7Y=";
} Note 1: hashes hash and cargoHash above are for v1.8.0 specifically. One could set them to lib.fakeHash; let the build fail with the error specifying the right hash, paste the correct hash and rebuild. Note 2: If tests fail due to missing git in your build environment, one can set this up with doCheck = false. you can activate the derivation above in your home.nix with home.nix { config, pkgs, ... }: let garden = pkgs.callPackage ./derivations/garden.nix {};
in
{ home.packages = [ garden ]
} then run home-manager switch to activate the changes.
